n_qubits = 133
stab_strings = [stim.PauliString(s) for s in stabilizers]

# Use stim's tableau method
try:
    tableau = stim.Tableau.from_stabilizers(stab_strings, allow_underconstrained=True, allow_redundant=True)
    circuit = tableau.to_circuit(method='elimination')
    print("Circuit generated successfully!")
    print(f"Circuit has {len(circuit)} operations")
    print(circuit)
except Exception as e:
    print(f"Error: {e}")
